blackboard.getCourseAnalytics = async (e) => {
  try {
    const href = window.location.href;
    let courseId = {};
    if (/ultra\/courses/.test(href)) {
      courseId = href.match(/\/courses\/(.*?)\/analytics/);
    } else {
      courseId = href.match(/\/organizations\/(.*?)\/analytics/);
    }
    e.target.parentNode.parentNode
      .querySelector("li.active")
      .classList.remove("active");
    e.target.parentNode.classList.add("active");
    const $viewContainer = document.querySelector(".view-container");
    $viewContainer.innerHTML = `<div><h1 style='text-align:center;margin-top:55px'>
      Consultando...<br /></h1>
      <p><img style="margin:auto;display:block" src="data:image/gif;base64," 
      </p><h1 style='text-align:center;'>Puede tardar varios segundos dependiendo de la cantidad de estudiantes y actividades del curso.</h1>
      </div>`;

    const users = await api.getUsersByCourse(courseId[1]);
    const rgx = new RegExp("_(.*?)_1");
    courseId = courseId[1].match(rgx);
    if (courseId.length > 0) {
      const content = document.createElement("div");
      content.innerHTML = `
        <h1>Usuarios del curso</h1>
        <table id="analyticsDetail">
        <thead style="text-align:left;">
          <tr style="border-bottom:1px solid #ccc;border-top:1px solid #ccc">
            <th style="padding:15px 0px">Estudiante</th>
            <th>Email</th>
            <th>Último acceso</th>
            <th>Fecha de inscripción</th>
            <th>Fecha de cambio de la matrícula</th>
            <th>Detalle</th>
          </tr>
          </thead>
          
            `;
      let body = ``;
      users.results.sort((a, b) =>
        a.user.name.given.localeCompare(b.user.name.given)
      );
      if (
        window["courseAnalytics" + courseId[1]] === null ||
        window["courseAnalytics" + courseId[1]] === undefined
      ) {
        let r = await api.getCourseAnalytics(courseId[1]);
        r = r.result;
        window["courseAnalytics" + courseId[1]] = r;
      }

      for (const user of users.results) {
        body += `
          <tr style="border-bottom:1px solid #ccc">
          <td style="padding:15px 0px">${user.user.name.given} ${
          user.user.name.family
        }</td>
          <td style="padding:15px 0px">${user.user.contact.email}</td>
          <td style="padding:15px 0px">${util.formatDate(
            user.lastAccessed
          )}</td>
          <td style="padding:15px 0px">${util.formatDate(user.created)}</td>
          <td style="padding:15px 0px">${util.formatDate(user.modified)}</td>`;
        if (
          window["courseAnalytics" + courseId[1]].find(
            (x) => x.EMAIL === user.user.contact.email
          ) != undefined
        ) {
          body += `<td style="padding:15px 0px"><a class="viewAnalyticDetail" data-id="${user.user.id
            .substring(1)
            .replace("_1", "")}" data-course='${courseId[1]}'>Ver</a></td>`;
        } else {
          body += `<td style="padding:15px 0px">N/A</td>`;
        }
        body += `</tr>`;
      }

      content.innerHTML += `<tbody></tbody></table>`;
      $viewContainer.innerHTML = "";
      $viewContainer.append(content);
      // window["swal"]({ content });
      const bd = document.createElement("tbody");
      bd.innerHTML = body;
      const analyticsDetail = document.querySelector("#analyticsDetail");
      analyticsDetail.appendChild(bd);
      analyticsDetail.style.width = "100%";
    }
  } catch (error) {
    util.doCatch(error);
  }
};
blackboard.getCourseAnalyticsDetail = async (e) => {
  try {
    const id = e.target.getAttribute("data-id");
    const course = e.target.getAttribute("data-course");
    // const dataInfo = JSON.parse(e.target.getAttribute("data-info")).result;
    const dataInfo = window["courseAnalytics" + course];
    if (dataInfo == null) {
      alert("Aun se está consultando la analítica");
      return false;
    }

    const filtered = dataInfo.filter((x) => x.SOURCEID == id);
    const unique = [];
    for (const item of filtered) {
      const idx = unique.findIndex((x) => x.id == item.ACTIVITY) === -1;
      if (idx) {
        unique.push({ id: item.ACTIVITY, count: 0 });
      }
    }
    let auto = 0;
    for (const u of unique) {
      let sum = 0;
      for (const f of filtered) {
        if (f.ACTIVITY == u.id) {
          sum += f.CLICKS;
        }
      }
      unique[auto].count = sum;
      auto++;
    }
    unique.sort((a, b) => (a.count < b.count ? 1 : -1));

    if (unique.length > 0) {
      const content = document.createElement("div");
      content.innerHTML = `
        <h1>Acceso a los recursos de ${filtered[0].NAMES} ${filtered[0].LASTNAME}</h1>
        <table id="analyticsDetailClicks">
        <thead style="text-align:left;">
          <tr style="border-bottom:1px solid #ccc;border-top:1px solid #ccc">
            <th style="padding:15px 0px">Recurso</th>
            <th>Accesos</th>
          </tr>
          </thead>

            `;
      let body = ``;
      for (const u of unique) {
        body += `
          <tr style="border-bottom:1px solid #ccc">
          <td style="padding:15px 0px">${u.id}</td>
          <td style="padding:15px 0px">${u.count}</td>          
          </tr>`;
      }
      content.innerHTML += `<tbody></tbody></table>`;
      document.querySelector(".view-container").innerHTML = "";
      document.querySelector(".view-container").appendChild(content);
      // window["swal"]({ content });
      const bd = document.createElement("tbody");
      bd.innerHTML = body;
      const analyticsDetail = document.querySelector("#analyticsDetailClicks");
      analyticsDetail.appendChild(bd);
      analyticsDetail.style.width = "100%";
    } else {
      alert("No se encontró analítica del usuario");
    }
  } catch (error) {
    util.doCatch(error);
  }
};

