blackboard.getSessionsByCourseId = async (courseId) => {
  let response = {};
  try {
    response = await fetch(
      `https://ucentral.blackboard.com/learn/api/v1/courses/_${courseId}_1/collabultra/sessions?expand=sessionInstances&sessionCategory=course`
    );
    response = await response.json();
  } catch (error) {
    util.doCatch(error);
  }
  return response;
};

blackboard.saveSessionInfo = async (info) => {
  try {
    const data = {
      method: "post",
      headers: {
        "Content-type": "Application/json",
      },
      body: JSON.stringify(info),
    };
    let response = await fetch(
      `http://localhost:5000/virtual-ucentral/us-central1/httpBBSessions`,
      data
    );
    response = await response.json();
  } catch (error) {
    util.doCatch(error);
  }
};

blackboard.updateSession = async (courseId, sessionId) => {
  try {
    var myHeaders = new Headers();
    myHeaders.append(
      "X-Blackboard-XSRF",
      "8f39c285-3c5c-4aed-8cb2-1234b57da98e"
    );

    myHeaders.append("Content-Type", "application/json;charset=UTF-8");

    var raw = '{"courseRoomEnabled":false}';

    var requestOptions = {
      method: "POST",
      headers: myHeaders,
      body: raw,
      redirect: "follow",
    };

    let response = await fetch(
      `https://ucentral.blackboard.com/learn/api/v1/courses/_${courseId}_1/collabultra/sessions/${sessionId}`,
      requestOptions
    );
    response = await response.json();
  } catch (error) {
    util.doCatch(error);
  }
};

